import { Component } from '@angular/core';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { DocumentTypeModel } from 'src/app/Models/DocumentType/DocumentTypeModel';
import { GetRolModel } from 'src/app/Models/Rol/RolModel';
import { CreateUserModel } from 'src/app/Models/Users/CreateUserModel';
import { UserServiceService } from 'src/app/services/Users/user-service.service';

@Component({
  selector: 'app-register',
  templateUrl: './register.component.html',
  styleUrls: ['./register.component.scss']
})
export class RegisterComponent {

  import { Component } from '@angular/core';
  import { FormBuilder, FormGroup } from '@angular/forms';
  import { GetUserModel } from 'ruta-del-modelo';

  @Component({
    selector: 'app-formulario-registro',
    templateUrl: './formulario-registro.component.html',
    styleUrls: ['./formulario-registro.component.css']
  })
  export class FormularioRegistroComponent {
    registroForm: FormGroup;
    imagenSeleccionada: File;

    constructor(private formBuilder: FormBuilder) {
      this.registroForm = this.formBuilder.group({
        name: '',
        image: '',
        lastName: '',
        secondLastName: '',
        dateOfBirth: '',
        numberPhone: '',
        document: '',
        email: '',
        password: '',
        documentTypeId: 0,
        addressId: 0,
        rolId: 0
      });
    }

    onImagenSeleccionada(event: any): void {
      this.imagenSeleccionada = event.target.files[0];
    }

    onSubmit(): void {
      const formData = new FormData();
      formData.append('name', this.registroForm.value.name);
      formData.append('image', this.registroForm.value.image);
      formData.append('lastName', this.registroForm.value.lastName);
      formData.append('secondLastName', this.registroForm.value.secondLastName);
      formData.append('dateOfBirth', this.registroForm.value.dateOfBirth);
      formData.append('numberPhone', this.registroForm.value.numberPhone);
      formData.append('document', this.registroForm.value.document);
      formData.append('email', this.registroForm.value.email);
      formData.append('password', this.registroForm.value.password);
      formData.append('documentTypeId', this.registroForm.value.documentTypeId);
      formData.append('addressId', this.registroForm.value.addressId);
      formData.append('rolId', this.registroForm.value.rolId);

      if (this.imagenSeleccionada) {
        formData.append('imagen', this.imagenSeleccionada);
      }

      // Enviar formData al backend
      // Ejemplo de cómo enviarlo utilizando HttpClient:
      // this.http.post('ruta-del-backend', formData).subscribe(response => {
      //   // Procesar la respuesta del backend
      // });
    }
  }
<div class="container">
  <form [formGroup]="registroForm" (ngSubmit)="onSubmit()">
    <!-- Campos del formulario... -->
    <div>
      <label for="name">Nombre:</label>
      <input type="text" id="name" formControlName="name" />
    </div>
    <div>
      <label for="image">Imagen:</label>
      <input type="file" id="image" (change)="onFileChange($event)" />
    </div>
    <div>
      <label for="lastName">Apellido:</label>
      <input type="text" id="lastName" formControlName="lastName" />
    </div>
    <div>
      <label for="secondLastName">Segundo Apellido:</label>
      <input type="text" id="secondLastName" formControlName="secondLastName" />
    </div>
    <div>
      <label for="dateOfBirth">Fecha de Nacimiento:</label>
      <input type="date" id="dateOfBirth" formControlName="dateOfBirth" />
    </div>
    <div>
      <label for="numberPhone">Número de Teléfono:</label>
      <input type="text" id="numberPhone" formControlName="numberPhone" />
    </div>
    <div>
      <label for="document">Documento:</label>
      <input type="text" id="document" formControlName="document" />
    </div>
    <div>
      <label for="email">Email:</label>
      <input type="email" id="email" formControlName="email" />
    </div>
    <div>
      <label for="password">Contraseña:</label>
      <input type="password" id="password" formControlName="password" />
    </div>
    <div>
      <label for="documentTypeId">Tipo de Documento:</label>
      <input type="text" id="documentTypeId" formControlName="documentTypeId" />
    </div>
    <div>
      <label for="addressId">ID de Dirección:</label>
      <input type="text" id="addressId" formControlName="addressId" />
    </div>
    <div>
      <label for="rolId">ID de Rol:</label>
      <input type="text" id="rolId" formControlName="rolId" />
    </div>
    <button (click)="onSubmit()" type="submit">Registrarse</button>
  </form>
</div>
